export async function emailBenvenuto(utente){
    return await axios.post("http://localhost:8080/ExoBankRest/rest/emailRest/emailBenvenuto",utente).then((response) =>{
      if(response.status==200){
        alert("email status 200")
      }
    }).catch((error )=>{
      alert("catch email")
      console.log(error)
  
    })
  }
